import React, { useEffect, useState, Component} from 'react'
import axios from 'axios'
import styles from './style.css'

class Dashboard extends Component {
    constructor(props) {
        super(props)

        this.state = {
        }
    }

    componentDidMount() {
        if (this.state.logged_in) {
            fetch('http://localhost:8000/api/current_user/', {
                headers: {
                    Authorization: `JWT ${localStorage.getItem('token')}`
                }
            })
                .then(res => res.json())
                .then(json => {
                    if (json.hasOwnProperty('email')) {
                        this.setState({ ...this.state, email: json.email }, () => {
                            console.log("componentDidMount Dashboard Set Called ");
                            console.log("json", json);
                            console.log("state", this.state);
                        });
                    }
                    else {
                        this.setState({ logged_in: false, email: '' }, () => {
                            console.log("componentDidMount Dashboard Reset Called ");
                            console.log("json", json);
                            console.log("state", this.state);
                        });
                    }

                });
        }
    }



    render() {
        const logged_in_dashboard = (
            <div>
                Welcome {this.state.email}
                <div onClick={this.props.handle_logout}>Logout</div>
            </div>)

        const logged_out_dashboard = (
            <div>
                Login To View Dashboard
            </div>)

        return (
            <div>
                <br /><br /><br /><br />
                {
                    this.state.logged_in ? logged_in_dashboard : logged_out_dashboard
                }
            </div>
        )
    }
}

export default Dashboard;
